window.bookSummaryJSON = "<p><b>An Enemies-to-Lovers Stand-Alone.</b></p> <p>Once upon a cold, dark night, a Russian killer stole me from an alley.<br> I’m dangerous, but he is lethal.<br> I escaped once.<br> He won’t let me do it twice.</p> <p>The revenge is his. <br> The betrayal is mine.<br> But so are the lies to protect the ones I love.</p> <p>We’re cut from the same twisted cloth. Both merciless. Both damaged. <br> In his embrace, I find hell and heaven, his cruelly tender touch destroying and uplifting me at once.</p> <p>They say a cat has nine lives, but an assassin has just one.<br> And Yan Ivanov now owns mine.</p>"; 
